import App from '../page-objects/App';
import Base from '../page-objects/Base';
import Weather from '../page-objects/pages/Weather';
import assert from 'assert';

describe('test weather forcast page', () => {

    it('go to dark sky page', () => {
        App.openDarkSkyNet();
    });

    it('input with zipcode 10001 to location', () => {
        Weather.fillLocationInputBox('10001');
    });

    it('click search button', () => {
        Weather.submitLocation();
    });

    it('weather forcast bar increment by 2 hours from now', () => {
        Weather.hoursTimelineVisible();
        let hours = Weather.sortTimex();

        for(var i=1; i<hours.length-1; i++){
            assert.equal(hours[i]-hours[i+1], '2', 'not true');
        }
    });

    it('verify current temp is not lower than timeline temp', () => {
        let currentTemp = Weather.currentTemp;
        for (var i=1; i<Weather.tempsText.length;i++){
            assert.isAtLeast(currentTemp, Weather.tempsText[i], 'current temp is less than timeline temp');
        }
    })

    t('verify current temp is not greater than timeline temp', () => {
        let currentTemp = Weather.currentTemp;
        for (var i=1; i<Weather.tempsText.length;i++){
            assert.isAbove(currentTemp, Weather.tempsText[i], 'current temp is greater than timeline temp');
        }
    })

});

